import React, { useState } from "react";
import { Stickers } from "./Stickers";
import styled from "styled-components";
import { useNavigate } from "react-router-dom";
import Modal from "react-modal";

const ModalStyle = {
  overlay: {
    position: "fixed",
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    backgroundColor: "rgba(255, 255, 255, 0.75)",
  },
  content: {
    height: "20vh",
    width: "70vw",
    top: "50vh",
    left: "50vw",
    right: "auto",
    bottom: "auto",
    boxShadow: "0px 4px 16px #00000040",
    transform: "translate(-50%, -50%)",
    borderRadius: "20px",
    border: "none",
  },
};

const YesButton = styled.button`
  background-color: #5d31ff;
  border-radius: 10px;
  box-shadow: 0px 4px 16px #00000040;
  border: 1px none;
  display: flex;
  justify-content: center;
  align-items: center;
  width: 30vw;
  color: white;
  height: 60%;
  margin-left: 2vw;
`;

const ModalContents = styled.div`
  justify-content: center;
  display: flex;
  flex-direction: column;
  height: 100%;
`;
const NoButton = styled.button`
  background-color: #f4f3f9;
  border-radius: 10px;
  box-shadow: 0px 4px 16px #00000040;
  border: 1px none;
  display: flex;
  justify-content: center;
  align-items: center;
  width: 30vw;
  height: 60%;
  margin-right: 2vw;
`;

const YNButton = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  display: flex;
  flex-direction: row;

  height: 8vh;
  padding: 2%;
`;

const ModalText = styled.p`
  text-align: center;
  font-size: 15px;
  font-weight: 600;
  justify-content: center;
  align-items: center;
`;

const Background = styled.div`
  display: flex;
  height: 100vh;
  flex-direction: column;
  width: 100vw;
  background-color: #5d31ff;
`;

const Header = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  height: 20vh;
  pointerevents: none;
`;

const StickerWrap = styled.div`
  height: 60vh;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const Text1 = styled.div`
  color: white;
  font-size: 15px;
  font-weight: 400;
`;
const Text2 = styled.div`
  color: white;
  font-size: 20px;
  font-weight: 400;
`;

const Text3 = styled.div`
  color: white;
  font-size: 20px;
  font-weight: 700;
`;
const Text4 = styled.div`
  color: white;
  font-size: 20px;
  font-weight: 700;
`;

const ButtonWrap = styled.div`
  height: 20vh;
  flex-direction: row;
  display: flex;
  width: 100vw;
  justify-content: center;
  align-items: center;
  pointerevents: none;
`;

const CompleteButton = styled.div`
  border-radius: 0.625rem;
  width: 30vw;
  height: 5vh;
  background: #f4f3f9;
  box-shadow: 0px 4px 10px 0px rgba(0, 0, 0, 0.25);
  display: flex;
  font-size: 80%;
  font-weight: 600;
  justify-content: center;
  align-items: center;
`;
const ButtonWrap2 = styled.div`
  flex-direction: row;
  display: flex;
  width: 100vw;

  justify-content: center;
  align-items: center;
  pointerevents: none;
`;
const CompleteButton2 = styled.div`
  border-radius: 0.625rem;
  width: 30vw;
  height: 5vh;
  margin-right: 3vw;
  margin-left: 3vw;
  background: #f4f3f9;
  box-shadow: 0px 4px 10px 0px rgba(0, 0, 0, 0.25);
  display: flex;

  font-size: 13px;
  font-weight: 600;
  justify-content: center;
  align-items: center;
`;
const Footer = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  pointerevents: none;
  height: 20vh;
  width: 100vw;
`;
const Second5 = styled.div`
  color: white;
  display: flex;

  justify-content: center;
  align-items: center;
  text-align: center;
  height: 30%;
  font-size: 15px;
`;
export function PutStickerVisitor() {
  const hostNickname = "수민";
  const [complete, setComplete] = useState(true);
  const [textChange, setTextChange] = useState(true);
  const navigate = useNavigate();
  const [modalIsOpen, setModalIsOpen] = useState(false);

  const openModal = () => {
    setModalIsOpen(true);
  };

  const closeModal = () => {
    setModalIsOpen(false);
  };

  const handleButtonClick = () => {
    setTimeout(() => {
      navigate("/main");
    }, 5000); //5초(5000) 뒤 메인화면으로 이동
    setComplete(false);
    setTextChange(false);
  };
  return (
    <Background>
      {textChange && (
        <Header>
          <Text1>부착한 스티커는 호스트 외 삭제할 수 없습니다.</Text1>
          <Text2>스티커를 붙여보세요.</Text2>
        </Header>
      )}

      {!textChange && (
        <Header>
          <Text3>'{hostNickname}'님의 프로필</Text3>
          <Text4>방문자를 확인해보세요.</Text4>
        </Header>
      )}

      <StickerWrap>
        <Stickers />
      </StickerWrap>
      {complete && (
        <ButtonWrap onClick={handleButtonClick}>
          <CompleteButton>부착 완료</CompleteButton>
        </ButtonWrap>
      )}

      <Modal
        style={ModalStyle}
        isOpen={modalIsOpen}
        onRequestClose={closeModal}
        contentLabel="Faceticker-Modal"
      >
        <ModalContents>
          <ModalText>
            현재 부착한 스티커 그대로 프로필 페이지를 만들어보세요.
          </ModalText>
          <YNButton>
            <NoButton onClick={closeModal}>X</NoButton>
            <YesButton>O</YesButton>
          </YNButton>
        </ModalContents>
      </Modal>

      {!complete && (
        <Footer>
          <Second5>5초 뒤 메인화면으로 이동합니다.</Second5>
          <ButtonWrap2>
            <CompleteButton2 onClick={openModal}>
              내 프로필도 만들기
            </CompleteButton2>
            <CompleteButton2 onClick={() => navigate("/qna")}>
              질문도 남기러 가기
            </CompleteButton2>
          </ButtonWrap2>
        </Footer>
      )}
    </Background>
  );
}

export default PutStickerVisitor;
